import React, { useContext } from 'react';
import { MyContext } from '../provider/MyProvider';

export default function PokemonInfoModal() {
  const { currentPokemon } = useContext(MyContext);

  return (
    <div>
      { currentPokemon.name && currentPokemon.map((pokemon) => (
        <h3>{ pokemon.name }</h3>
      )) }
    </div>
  );
}
